import React from 'react'
//css
import './CardTable.css'
//componenets
import Card from '../Card/Card'

export default function CardTable(props) {

    return (
        <div className="CardTable">
            {
                props.info.map((element) => {
                    return <Card 
                    id={element.id}
                    pic={element.sprites.other[1]} 
                    key={element.name}/>
                })
            }
        </div>
    )
}
